  const colorBand = (color) => {
    switch (color) {
      case "red":
        return handAsset;
      case "green":
        return floppyAsset;
      case "purple":
        return mailAsset;
      case "yellow":
        return smileyAsset;

      default:
        return handAsset; // Handle other cases or provide a default value
    }
  };

  const backgroundColor = (color) => {
    switch (color) {
      case "red":
        return "var(--red)";

      case "green":
        return "var(--green}";

      case "purple":
        return "var(--purple)";

      case "yellow":
        return "var(--yellow)";

      default:
        return "var(--red)"; // Handle other cases or provide a default value
    }
  };

  return (
    <div
      className={styles.band}
      style={{
        background: backgroundColor(color),
        transform: `rotate(${rotate}deg)`,
        transformOrigin: origin ?? "center",
        margin: 8,
        top: top ?? 0,
        zIndex: index,
        left: left ?? "0",
      }}
    >
      {colorBand(color)}
    </div>
  );
